import Navbar from './Navbar';
import '../assets/css/Dashboard.css'

function Dashboard() {
  return (
    <div className="App-dashboard">
    <Navbar />
    <div className="dashboard-content">
      <div className="profile-box">
        <div className="menu">

        </div>
      </div>
    </div>
    </div>
  );
}

export default Dashboard;
